import React from "react";
import sofaGreenMaria from "../images/sofaGreenMaria.PNG";
import chairStreetMaria from "../images/chairStreetMaria.PNG";
import sofaOwlMaria from "../images/sofaOwlMaria.PNG";
import index from "../stylesheets/index.css";

function Index() {
  return (
    <div
      class="bg_image"
      style={{
        backgroundImage: `url(${sofaGreenMaria})`,
        backgroundSize: "cover",
        height: "100vh",
      }}
    >
      <a href="/cello" style="text-decoration:none">
        Cello
      </a>
      <a href="/aboutartist">About The Artist</a>
      <a href="/recommendations">Recommendations</a>
      <a href="/soundtracks">Soundtracks For Sofas</a>
      <a href="/theworldaroundsofa">The World Around Sofa</a>
      <a href="/aboutproject">The Sofa Project</a>
    </div>
  );
}

export default Index;
